def choose_random_attack(attacks=false_attacks):
    attack_type = choice(list(attacks.keys()))
    attack = choice(attacks[attack_type])
    return attack_type, attack


class Client:
    def __init__(self, port):
        self.sio = socketio.Client()
        self.port = port

        @(self.sio).event
        def connect():
            print('Log collection tool connected to server')

        self.connectToServer(port)

    def sendToServer(self, func, data, generate_false_attacks):

        # !!
        if generate_false_attacks and (choices([0, 1], weights=[0.01, 0.99])[0]):
            # kept 0 or 1 for now #! this determines the number of false attacks to be generated... important, as should be greater than attack threshold
            number_of_false_attacks = randint(80, 100)
            for i in range(number_of_false_attacks):
                attack_type, attack = choose_random_attack(false_attacks)
                print("CONSOLE_LOG: Sending false attack: ", attack_type)
                data["data"].append(attack)

        if len(data["data"]) != 0:

            # TODO: this giving error, bad namespace, try doing this, after the connection is established.. and if got that error, try to connect again
            try:
                self.sio.emit(func, data)
            except Exception as e:
                # print(e)
                self.connectToServer(self.port)
                self.sio.emit(func, data)

            self.sio.sleep(1)

    def connectToServer(self, port):
        self.sio.connect(f'http://localhost:{port}', wait_timeout=20)

    def disconnectFromServer(self):
        self.sio.disconnect()

    # events..


